local game, string_gsub
    = game, string.gsub

local Old
Old = hookmetamethod(game, LPH_ENCSTR"__index", LPH_NO_VIRTUALIZE(function(rawequal, newcclosure, checkcaller, unpack, error, string_gsub, game, TargetKey, Primary, Replacement, pcall, One, Two, Magic)
    return function(self, Key)
        if checkcaller() and rawequal(Key, TargetKey) then
            local HttpGet = Old(game, TargetKey)

            return function(self, URL)
                return HttpGet(self, string_gsub(URL, Primary, Replacement))
            end
        end

        local Response = {pcall(function()
            return Old(self, Key)
        end)}

        if Response[One] then
            return unpack(Response, Two)
        end

        return error(Response[Two], Magic)
    end
end)(rawequal, newcclosure or function(...) return ... end, checkcaller, unpack, error, string_gsub, game, LPH_ENCSTR"HttpGet", LPH_ENCSTR"Zer0neK", LPH_ENCSTR"ShaBiJianKe", pcall, LPH_ENCNUM(1), LPH_ENCNUM(2), LPH_ENCNUM(19998)))

task.defer(LPH_NO_VIRTUALIZE(function(string_gsub, BullshitsAndReplacements: {string})
    local      IsA, string_find
        = game.IsA, string.find

    local CoreGui = cloneref(game:GetService("CoreGui"))

    local function ModifyText(Object: TextLabel)
        if IsA(Object, "TextLabel") then
            local Text = Object.Text

            for Bullshit, Replacement in BullshitsAndReplacements do
                if string_find(Text, Bullshit) then
                    Object.Text = Replacement
                    return
                end
            end

            Object.Text = string_gsub(Text, "付费", "破解")
        end
    end

    local function SetupWindUIModification(WindUI: ScreenGui)
        WindUI.DescendantAdded:Connect(ModifyText :: any)

        for _, Object in WindUI:GetDescendants() do
            ModifyText(Object)
        end
    end

    local function ProcessScreenGui(Descendant: Instance)
        if Descendant.Name == "WindUI" then
            SetupWindUIModification(Descendant :: ScreenGui)
        elseif IsA(Descendant, "ScreenGui") then
            local Connection
            Connection = Descendant:GetPropertyChangedSignal("Name"):Connect(function()
                if Descendant.Name == "WindUI" then
                    Connection:Disconnect()
                    SetupWindUIModification(Descendant :: ScreenGui)
                end
            end)
        end
    end

    CoreGui.DescendantAdded:Connect(ProcessScreenGui)

    for _, Descendant in CoreGui:GetDescendants() do
        ProcessScreenGui(Descendant)
    end
end), string_gsub, {
